import React from "react";

import "./Icons.css";

function Icons({ info }){
    if (!info) {
        console.error("No se recibió `info` en el componente Icons");
        return null;
    }
    return(
        <div className="icons-container">
<div className="iconc-content">   

    <div className="circle-background">
        <img
        src= {info.image} 
        alt= "Icon" 
        className="icon-image" 
        style={{ width: "60px",top: "18px", left:"20px"}}/>
    </div>
   <div className="title-icon">
    <h4>{info.title}</h4>
   </div>
</div>

</div>
    )
}
export default Icons
